import './App.css';
import React, { useRef } from "react";
import styled from 'styled-components'
import Experiencias from './components/Experiencias'

function App() {

  const myRefQuemSou = useRef(null)
  const executeScroll = () => myRefQuemSou.current.scrollIntoView()
  const myRefProjetos = useRef(null)
  const executeScroll1 = () => myRefProjetos.current.scrollIntoView()
  const myRefContato = useRef(null)
  const executeScroll2 = () => myRefContato.current.scrollIntoView()

  return (
    <div className="App">

       {/* header*/}
      <header className="App-Bar">
        <div>
          <p className="carolaine">Carolaine</p>
        </div>

        <div className="App-link"> 
          <p onClick={executeScroll} className="quem-sou">quem sou</p>
          <p onClick={executeScroll1} className="quem-sou">projetos</p>
          <p onClick={executeScroll2} className="quem-sou">contato</p>
        </div>
      </header>

      <div className="center">
        <h1>Carolaine Viana</h1>
        <h2>Desenvolvedora Web Junior</h2>
            <p className="sobre-mim-text">
              <h1>Sobre mim</h1>
              Meu nome é carolaine, tenho 23 anos, sou formada em Sistema de informacao pela Unisales.
              Fiz vários estágios na area de tecnologia, margitoriamente em Suporte.
              Estou buscando uma oportunidade na area de desenvolvimento. 
              Meu nome é Daniel, estou a muitos anos na área de pecuária de corte. Depois de 12 anos na fazenda, queria fazer algo diferente e resolvi fazer faculdade de Análise e Desenvolvimento de Sistemas, assim descobri minha paixão por desenvolvimento web. Primeiro aprendi Python com Flask, fui pulando várias tecnologias até fazer o curso da Dr Angela Yu The Complete 2020 Web Development Bootcamp (Udemy). Fiz dezenas de cursos pela net. Finalmente entrei em um curso Fullstack da Labenu em qual aprendi react, typescript, por 6 meses fiz muitos projetos, além disso aprendi orientação a objeto, arquitetura em camadas e infraestrutura da AWS. Agora estou a procura da primeira oportunidade de trabalho na área de desenvolvimento web Fullstack
              </p>
            <img src="https://images.unsplash.com/photo-1522252234503-e356532cafd5?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=925&q=80"/>
      </div>

    <div className="center2">
      <h1>Skills</h1>
      <div className="skill1">
          <h3>Desenvolvimento de aplicações web utilizando React, HTML, CSS e JavaScript.<br/></h3>
        </div>
        <div className="skill2">  
        <h3>Versionamento de git adadasdadasdasdasdasdsadsadsaddas<br/></h3>
        </div>
    </div>


    <div className="center3">
    <h1>Educacao</h1>
    <div className="education1">
        <h2>Bacharel em sistema da informacao</h2>
    </div>
    <div className="education2">
      <h2>Certificacao Scrum Foundation</h2>
    </div>
    <div className="education3">
    <h2>Web Full Stack na Labenu</h2>
      </div>
    </div>

    <div className="center4">
      <h1>Experiencia de mercado: </h1>
      <div className="exp">
      <Experiencias
          cargo={'estagiaria'}
          empresa={'Time now engenharia'}
          descricao={'bldplpadlapdssad'}
          // foto={"https://img.icons8.com/bubbles/50/000000/broken-computer.png"}
        />
      </div>
      <div className="exp">
      <Experiencias
          cargo={'teste'}
          empresa={'teste'}
          descricao={'teste'}
        />
        </div>
    </div>

    <div className="exp">
      <Experiencias
          cargo={'teste2'}
          empresa={'teste2'}
          descricao={'teste2'}
        />
        </div>
    </div>

  );
}

export default App;
